description:
SoundSpectrum provides easy-to-use, yet advanced music visualization software in the form of media player plugins and full-featured applications.

G-Force is the most dynamic and sophisticated, yet entirely artistic, music visualization available - and it keeps getting better.


G-Force Platinum includes both the Windows 2000/XP and Mac OS X (Universal support) versions and supports Windows Media Player, Musicmatch, iTunes (Windows), iTunes (Mac OS X), jetAudio, Google Sidebar, J. River Media Center, Real Player, Winamp, MediaMonkey, Quintessential Player, XMPlay, and MediaPortal.


G-Force Platinum also includes G-Force Screen Saver and G-Force Standalone.
